import "./sidebar.css" 
const Sidebar = () => {
    return (
        <div>
             <FontAwesomeIcon icon="check-square" />
    Your <FontAwesomeIcon icon="coffee" /> is hot and ready!
           <FontAwesomeIcon icon={['fab', 'google']} /> 
         
